import React from "react";
import { Link } from 'react-router-dom';


const Nav = () => {
    return(
        <nav>
            <Link to='/'>About</Link>
            <Link to='/about'>About</Link>
            <Link to='/get-started'>Get Started</Link>
            <Link to='/code'>Code</Link>
        </nav>
    )
}
export default Nav
